            nextLabel={ <div className="icon"><img src={iconNext} alt="next" /></div>}
            breakLabel={'...'}
            pageCount={countPages}
            onPageChange={handlePageClick}
            forcePage={page - 1}
            breakClassName={'rest'}
            containerClassName={'containerNavigation'}
            pageClassName={'page'}
        />
    )
}

export default Navigation;
